export class FeaturedLog {
    constructor() {
        this.label = 'Click me';
        this.onClickHandler = () => {
            console.log('');
            this.featuredLogClicked.emit();
        };
    }
    render() {
        return (h("button", { onClick: this.onClickHandler }, this.label));
    }
    static get is() { return "featured-log"; }
    static get encapsulation() { return "shadow"; }
    static get properties() { return {
        "el": {
            "elementRef": true
        },
        "label": {
            "type": String,
            "attr": "label",
            "reflectToAttr": true
        }
    }; }
    static get events() { return [{
            "name": "featuredLogClicked",
            "method": "featuredLogClicked",
            "bubbles": true,
            "cancelable": true,
            "composed": true
        }]; }
    static get style() { return "/**style-placeholder:featured-log:**/"; }
}
